import React from 'react';
import {BrowserRouter} from "react-router-dom";
import AppRouter from "./components/AppRouter";
import {observer} from "mobx-react-lite";
import Header from "../component/Header"

const App = observer(() => {

    return (
        <BrowserRouter>
            <Header/>
            <AppRouter />
        </BrowserRouter>
    );
});

export default App;
